  "text" : "自分はそんなことをずっと繰り返している気がする。最初はこのイメージも漠然としていて、ただ「自分は通りすぎるだけの存在かな」ぐらいにしか思っていなかったけど、今ではここまではっきりと見える。これが経験というものなんだろうな、と思う。",
