  "id_str" : "10783817330",
  "text" : "けどある時、ふとその人を見ると元気がない。どうしたのかと思ってると、その人は出口へ行こうとする。何かを言おうとするのだけど、うまく言葉にできない。何か言われたような気もするのだけど、聞こえてない。そうしてその人は去っていく。自分はまた一人になる。",
  "id" : 10783817330,
  "created_at" : "Sat Mar 20 18:13:52 +0000 2010",
