  "id_str" : "10783723385",
  "text" : "自分一人で部屋にいる。真白で何もない部屋。右に入口があって、左に出口がある。入口から色々な人が入ってくる。自分はそれを出迎えて、一緒に遊んだりしゃべったり、時には何もせずただそこに座っている。そうしてその人と親密になる。",
  "id" : 10783723385,
