  "text" : "完全流体って複素解析でうにゃうにゃしたら、きれいにまとまった形で出てくるから「応用数学」のいい例としてあげられるけど、スリップするし流体中の物体にかかる力を記述できない（境界層内部は扱えない）とかいう制約あがあるから、半ば「学者のお遊び」なんですよねぇ。",
