  "id_str" : "10108705323",
  "text" : "まぁ、物理とか機械系ならまだしも、土木系（特に水理学）では完全流体は複素ポテンシャル使うほど高度なことしない（せいぜい、ベルヌーイの定理ぐらい）。そもそも実用的なことやるときには全部経験則（モデル）でやるし。",
  "id" : 10108705323,
